As 04 Fases:

1* Fase é a do combate:
O povo vai para frente das FA;

2* Fase: o povo não aceita mais os desinformantes, onde ninguém engana mais o povo;

3* Fase: são aqueles que já estão de prontidão para o combate, e está ali porque quer. É nesse momento que se cria o espírito de corpo. Todos nós somos combatentes. Não há momento para terminar, há momento para a vitória;

4* Fase: não tenham pena! A corrupção mata, as ideologias matam. Não tenham pena! Não existem inocentes nesta altura do campeonato.

EMÍLIO SUKITA é o que sobrou da reserva moral desse país... 

COMO NÃO AMAR ESSE HOMEM?! Impossível…

